import React from 'react';
import PropTypes from 'prop-types';

const LogItem = ({ log }) => {
  return (
    <>
      <li className='collection-item'>
        <div>
          <a href='#edit-log-modal'>{log.message}</a>
          <br />
          <a href='#!' className='secondary-content' style={{ color: 'red' }}>
            <i className='material-icons'>delete</i>
          </a>
          <span>
            {`${kilo} Kilo - Launderer: Jane Doe, updated by Admin July 01, 2020`}
          </span>
        </div>
      </li>
    </>
  );
};

LogItem.propTypes = {
  log: PropTypes.object.isRequired,
};

export default LogItem;
